  false,\n\t\"url\": null,\n\t\"notes\": \"The Q3 Flood Data product is a digital
  representation of certain features of FEMA's Flood Insurance Rate Map (FIRM) product,
  intended for use with desktop mapping and Geographic Information Systems technology.
  Digital Q3 Flood Data has been developed by scanning the existing FIRM hardcopy,
  vectorizing a thematic overlay of flood risks. The vector Q3 Flood Data files contain
  only certain features from the existing FIRM hardcopy.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
